import { Box } from "@material-ui/core";
import React from "react";
import Hero from "../Components/Hero";
import OurWorks from "../Components/OurWorks";


const gap = "100px";
let header = {
  hero: {
    heading: "PORTFOLIO",
    page: "PortFolio",
    image: "/assets/image.png"
  }
};
function PortFolio() {
  return (
    <>
      <Hero {...header.hero} />
      <Box height={gap} />
      <OurWorks />

    </>
  );
}

export default PortFolio;
